let len = 50
let candle = record.current

variable.closeArray.push(candle.close)
if (variable.closeArray.length > len) { variable.closeArray.splice(0, 1) }

let tempArr = [...variable.closeArray]

tempArr.sort((a, b) => a - b)

variable.pnr1 = pnr(tempArr, 1)
variable.pnr2 = pnr(tempArr, 0.75)
variable.pnr3 = pnr(tempArr, 0.5)
variable.pnr4 = pnr(tempArr, 0.25)
variable.pnr5 = pnr(tempArr, 0)

// NaN -> 0
variable.pnr1 = variable.pnr1 || 0
variable.pnr2 = variable.pnr2 || 0
variable.pnr3 = variable.pnr3 || 0
variable.pnr4 = variable.pnr4 || 0
variable.pnr5 = variable.pnr5 || 0


function pnr(arr, p) {
	if (arr.length === 0) { return 0 }
	if (p <= 0) { return arr[0] }
	if (p >= 1) { return arr[arr.length - 1] }

	var index = (arr.length - 1) * p,
		lower = Math.floor(index),
		upper = lower + 1
	weight = index % 1

	if (upper >= arr.length) { return arr[lower] }

	return arr[lower] * (1 - weight) + arr[upper] * weight
}

let len = 50
let emaLen = 14
let candle = record.current

variable.closeArray.push(candle.close)
if (variable.closeArray.length > len) { variable.closeArray.splice(0, 1) }

//EMA smoothing
variable.EMA = calcEMA(emaLen, candle.close, variable.prevEMA)

//Sort array
let tempArr = [...variable.closeArray]
tempArr.sort((a, b) => a - b)

// Percentile Nearest Rank
variable.pnr1 = pnr(tempArr, 1)
variable.pnr2 = pnr(tempArr, 0.75)
variable.pnr3 = pnr(tempArr, 0.5)
variable.pnr4 = pnr(tempArr, 0.25)
variable.pnr5 = pnr(tempArr, 0)

//Normalizing
variable.normClose = normalize(candle.close, variable.pnr1, variable.pnr5)
variable.normEMA = normalize(variable.EMA, variable.pnr1, variable.pnr5)
variable.normPnr1 = normalize(variable.pnr1, variable.pnr1, variable.pnr5)
variable.normPnr2 = normalize(variable.pnr2, variable.pnr1, variable.pnr5)
variable.normPnr3 = normalize(variable.pnr3, variable.pnr1, variable.pnr5)
variable.normPnr4 = normalize(variable.pnr4, variable.pnr1, variable.pnr5)
variable.normPnr5 = normalize(variable.pnr5, variable.pnr1, variable.pnr5)

// NaN -> 0
variable.normClose = variable.normClose || 0
variable.normEMA = variable.normEMA || 0
variable.normPnr1 = variable.normPnr1 || 0
variable.normPnr2 = variable.normPnr2 || 0
variable.normPnr3 = variable.normPnr3 || 0
variable.normPnr4 = variable.normPnr4 || 0
variable.normPnr5 = variable.normPnr5 || 0

//Prev
variable.prevEMA = variable.EMA

// Percentile Nearest Rank calculations
function pnr(arr, p) {
	if (arr.length === 0) { return 0 }
	if (p <= 0) { return arr[0] }
	if (p >= 1) { return arr[arr.length - 1] }

	var index = (arr.length - 1) * p,
		lower = Math.floor(index),
		upper = lower + 1
	weight = index % 1

	if (upper >= arr.length) { return arr[lower] }

	return arr[lower] * (1 - weight) + arr[upper] * weight
}

//Normalization calculations
function normalize(val, max, min) {
	return (val - min) / (max - min)
}

// EMA calculations
function calcEMA(periods, price, previousEMA) {
	let k = 2 / (periods + 1)
	return price * k + previousEMA * (1 - k)
}

